create database FinanceStage
use FinanceStage
go 
-- customer stage
CREATE TABLE [Customer] (
    [customerID] int,
    [creditCard] varchar(50),
    [limit] int,
    [sex] bit,
    [name] varchar(50),
    [date_of_birth] datetime,
    [email] varchar(50),
    [phone_Number] varchar(50),
    [jobID] int,
    [education] int,
    [addressID] int
)
GO
-- job stage
CREATE TABLE [JobStage] (
    [jobID] int,
    [jobTitle] varchar(50),
    [income_basic] int
)
go 
-- address stage
CREATE TABLE AddressStage(
    [addressID] int,
    [city] varchar(50),
    [region] varchar(50)
)
go
--fact stage
CREATE TABLE [FactStage] (
    [transactionID] int,
    [customerID] int,
    [startDateKey] int,
    [endDateKey] int,
    [loan] int,
    [scorePredict] numeric(15,1)
)
